import 'bootstrap/dist/css/bootstrap.min.css';

import React, {Component} from 'react'


class HomePage extends Component {
    constructor(props) {
        super(props)
    this.state = {
        currentUser: props.user
     }
    }
    
    render () {
        return (
            <div>
                <h1>HOMEPAGE {this.state.currentUser}</h1>
            </div>
        )
    }

}
export default HomePage;
